<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <title>Generate Document plugin for IntelliJ platform IDEs</title>

    <!-- Vue3 -->
    <script src="https://cdn.jsdelivr.net/npm/vue@3.2.41/dist/vue.global.prod.js"></script>

    <!-- naive-ui -->
    <script src="https://cdn.jsdelivr.net/npm/naive-ui@2.33.5/dist/index.min.js"></script>

    <!-- highlightjs -->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/11.6.0/highlight.min.js"></script>

    <style>
        .pgdoc-deprecated {
            text-decoration: line-through;
        }
    </style>
</head><body>
<div id="pgdoc">
    <n-config-provider :hljs="hljs" :theme="themeApp">
        <n-layout style="height: 100vh;">
            <n-layout-header style="width: 90%; margin: 10px auto;" bordered>
                <n-space justify="space-between" :item-style="{'align-items': 'center', 'display': 'flex'}">
                    <n-h1 style="display: contents;">
                        <n-text type="primary"  id="home">Generate Document</n-text>
                    </n-h1>
                    <n-switch :rail-style="theme.style"
                              checked-value="dark" unchecked-value="light"
                              :default-value="theme.defaultTheme"
                              @update:value="theme.handleUpdateValue">
                        <template #checked>
                            Dark
                        </template>
                        <template #unchecked>
                            Light
                        </template>
                    </n-switch>
                </n-space>
            </n-layout-header>
            <n-layout-content content-style="width: 90%; margin: 10px auto;">
                <!--基础信息-->
                <n-list :show-divider="false">
                    <template #header>
                        <n-h1 style="display: inline;">
                            <n-text type="primary">API Descriptions</n-text>
                        </n-h1>
                    </template>
                    <n-list-item>
                        <template #prefix>
                            <n-h6 style="display: inline;">Generated:</n-h6>
                        </template>
                        <n-a href="https://plugins.jetbrains.com/plugin/13086-generate-document" target="_blank">
                            Generate Document plugin for IntelliJ platform IDEs
                        </n-a>
                    </n-list-item>
                    <n-list-item>
                        <template #prefix>
                            <n-h6 style="display: inline;">Author:</n-h6>
                        </template>
                        yinzhengfei                    </n-list-item>
                    <n-list-item>
                        <template #prefix>
                            <n-h6 style="display: inline;">Version:</n-h6>
                        </template>
                        0.0.1-SNAPSHOT                    </n-list-item>
                    <n-list-item>
                        <!-- 接口统计信息 -->
                        <template #prefix>
                            <n-h6 style="display: inline;">Count:</n-h6>
                        </template>
                        <n-space>
                            <n-statistic label="Class Count">
                                <n-number-animation :from="0" :to="statistics.classCount" :duration="10000"/>
                            </n-statistic>
                            <n-statistic label="Request Count">
                                <n-number-animation :from="0" :to="statistics.methodCount" :duration="10000"/>
                            </n-statistic>
                        </n-space>
                    </n-list-item>
                </n-list>

                <template v-if="classes && classes.length > 0">
                    <!--目录-->
                    <n-card header-style="padding-top: 0px; padding-bottom: 0px;"
                            hoverable size="small"
                            :style="{
                    width: catalog.width,
                    height: catalog.height,
                    position: 'fixed',
                    'overflow-y': 'auto',
                    right: '12px',
                    top: '90px',
                    'z-index': 9999,
                }">
                        <template #header>&nbsp;</template>
                        <template #header-extra>
                            <n-a style="margin-right: 10px;" @click="catalogBtnClick">{{catalog.btnText}}</n-a>
                        </template>
                        <template #default v-if="catalog.hideShow">
                            <n-anchor :show-rail="false">
                                <n-anchor-link title="Home" href="#home"></n-anchor-link>
                                <template v-for="clazz in classes" :key="clazz.className">
                                    <n-anchor-link
                                            :title="unescape(clazz.showName)"
                                            :href="'#' + clazz.id"
                                            :class="[clazz.deprecated ? 'pgdoc-deprecated':'']"
                                    >
                                        <template v-for="c in clazz.methods" :key="c.id">
                                            <n-anchor-link
                                                    :title="unescape(c.showName)"
                                                    :href="'#' + c.id"
                                                    :class="[c.deprecated ? 'pgdoc-deprecated':'']"
                                            />
                                        </template>
                                    </n-anchor-link>
                                    </n-anchor-link>
                                </template>
                            </n-anchor>
                        </template>
                    </n-card>
                    <!--遍历类-->
                    <template v-for="clazz in classes" :key="clazz.className">
                        <n-h1 prefix="bar" align-text
                              :id="clazz.id">
                            <n-text type="primary"
                                    :delete="clazz.deprecated"
                                    v-html="clazz.showName" />
                        </n-h1>

                        <!--遍历方法-->
                        <template v-for="api in clazz.methods">
                            <!--接口描述-->
                            <n-h2 prefix="bar" align-text
                                  :id="api.id">
                                <n-text type="primary"
                                        :delete="clazz.deprecated ? clazz.deprecated : api.deprecated"
                                        v-html="api.showName" />
                            </n-h2>

                            <n-descriptions label-placement="top" :column="1" :class="[clazz.deprecated ? 'pgdoc-deprecated': (api.deprecated ? 'pgdoc-deprecated':'')]">
                                <!--请求地址-->
                                <n-descriptions-item>
                                    <template #label>
                                        <n-h3 style="display: inline;">URL:&nbsp;</n-h3>
                                        <n-text>{{ api.url }}</n-text>
                                    </template>
                                </n-descriptions-item>

                                <!--Type-->
                                <n-descriptions-item>
                                    <template #label>
                                        <n-h3 style="display: inline;">Type:&nbsp;</n-h3>
                                        <n-text>{{ api.type }}</n-text>
                                    </template>
                                </n-descriptions-item>

                                <!--开发者-->
                                <n-descriptions-item v-if="api.author">
                                    <template #label>
                                        <n-h3 style="display: inline;">Author:&nbsp;</n-h3>
                                        <n-text>{{ api.author }}</n-text>
                                    </template>
                                </n-descriptions-item>

                                <!--Content-Type-->
                                <n-descriptions-item v-if="api.contentType">
                                    <template #label>
                                        <n-h3 style="display: inline;">Content-Type:&nbsp;</n-h3>
                                        <n-text>{{ api.contentType }}</n-text>
                                    </template>
                                </n-descriptions-item>

                                <!--请求Header-->
                                <n-descriptions-item v-if="api.headers && api.headers.length > 0"
                                                     content-style="width: 100%;">
                                    <n-h3>Request-headers:</n-h3>
                                    <n-data-table
                                            :columns="tablecolumns.headercolumns"
                                            :data="api.headers"
                                    />
                                </n-descriptions-item>

                                <!--请求Cookies-->
                                <n-descriptions-item v-if="api.cookies && api.cookies.length > 0"
                                                     content-style="width: 100%;">
                                    <n-h3>Request-cookies:</n-h3>
                                    <n-data-table
                                            :columns="tablecolumns.cookiescolumns"
                                            :data="api.cookies"
                                    />
                                </n-descriptions-item>

                                <!--Path参数-->
                                <n-descriptions-item v-if="api.pathParams && api.pathParams.length > 0"
                                                     content-style="width: 100%;">
                                    <n-h3>Path-parameters:</n-h3>
                                    <n-data-table
                                            :columns="tablecolumns.paramcolumns"
                                            :data="api.pathParams"
                                            children-key="childField"
                                            :default-expand-all="false"
                                            :row-key="rowKey"
                                    />
                                </n-descriptions-item>

                                <!--Query参数-->
                                <n-descriptions-item v-if="api.queryParams && api.queryParams.length > 0"
                                                     content-style="width: 100%;">
                                    <n-h3>Query-parameters:</n-h3>
                                    <n-data-table
                                            :columns="tablecolumns.paramcolumns"
                                            :data="api.queryParams"
                                            children-key="childField"
                                            :default-expand-all="false"
                                            :row-key="rowKey"
                                    />
                                </n-descriptions-item>
                                <n-descriptions-item
                                        v-else-if="(!api.requestBodyParams || api.requestBodyParams.length == 0) && (!api.pathParams || api.pathParams.length == 0)"
                                        content-style="width: 100%;">
                                    <n-h3>Query-parameters:</n-h3>
                                    <n-text>None</n-text>
                                </n-descriptions-item>

                                <!--Body参数-->
                                <n-descriptions-item v-if="api.requestBodyParams && api.requestBodyParams.length > 0"
                                                     content-style="width: 100%;">
                                    <n-h3>Body-parameters:</n-h3>
                                    <n-data-table
                                            :columns="tablecolumns.paramcolumns"
                                            :data="api.requestBodyParams"
                                            children-key="childField"
                                            :default-expand-all="false"
                                            :row-key="rowKey"
                                    />
                                </n-descriptions-item>

                                <!--Request Body示例-->
                                <n-descriptions-item v-if="api.requestBodyExample" content-style="width: 100%;">
                                    <n-h3>Request-body-example:</n-h3>
                                    <CodeView :code="api.requestBodyExample" language="json"/>
                                </n-descriptions-item>

                                <!--结果参数-->
                                <n-descriptions-item content-style="width: 100%;">
                                    <n-h3>
                                        {{api.result && api.result.fields && api.result.fields.length > 0 ? "Result-fields" : "Result"}}:
                                    </n-h3>
                                    <template v-if="api.result && api.result.fields && api.result.fields.length > 0">
                                        <n-data-table
                                                :columns="tablecolumns.responsecolumns"
                                                :data='[{"typeName":api.result.resultName,"docComment":api.result.docComment,"childField":api.result.fields, id:"qq:657812595"}]'
                                                children-key="childField"
                                                :default-expand-all="false"
                                                :row-key="rowKey"
                                        />
                                    </template>
                                    <template
                                            v-else-if="api.result && api.result.resultName !== 'none' && api.result.resultName !== 'void' && api.result.resultName !== 'java.lang.Void'">
                                        <n-data-table
                                                :columns="tablecolumns.responsenochildrencolumns"
                                                :data='[api.result]'
                                                children-key="childField"
                                                :default-expand-all="false"
                                                :row-key="rowKey"
                                        />
                                    </template>
                                    <n-text v-else>None</n-text>

                                </n-descriptions-item>

                                <!--结果示例-->
                                <n-descriptions-item v-if="api.resultExample" content-style="width: 100%;">
                                    <n-h3>Result-example:</n-h3>
                                    <CodeView :code="api.resultExample" language="json"/>
                                </n-descriptions-item>
                                <!--Curl示例-->
                                <n-descriptions-item v-if="api.curlExample" content-style="width: 100%;">
                                    <n-h3>Curl-example:</n-h3>
                                    <CodeView :code="api.curlExample" language="bash"/>
                                </n-descriptions-item>
                            </n-descriptions>

                        </template>
                    </template>
                </template>
                <template v-else>
                    <n-spin :show="loading" style="height: 10vh;">
                        <template #description>
                            Loading data...
                        </template>
                        <n-result>
                            <template #icon></template>
                        </n-result>
                    </n-spin>
                </template>
            </n-layout-content>
        </n-layout>
    </n-config-provider>
</div>
<!-- 组件模版 -->
<template id="doc-common-template">
    <n-tag type="warning" v-if="deprecated">Deprecated</n-tag>
    <div v-if="docs && docs.length > 0">
        <template v-for="doc in docs">
            <div>
                <n-text :delete="deprecated">{{doc}}</n-text>
            </div>
        </template>
    </div>
    <template v-if="dateTimeFormats && dateTimeFormats.length > 0" v-for="format in dateTimeFormats">
        <n-text type="success" :delete="deprecated">Pattern: {{format.value}}</n-text>
    </template>
</template>
<template id="code-view-template">
    <n-config-provider :theme="darkTheme">
        <n-card>
            <n-code :code="code" :language="language" word-wrap/>
        </n-card>
    </n-config-provider>
</template>
<script type="text/javascript">
    const {createApp, ref, h, onMounted, computed} = Vue;
    const {NText, NTag, useOsTheme, darkTheme} = naive;

    //组件-文档注释
    const DocCommon = {
        props: ['docs', 'deprecated', 'dateTimeFormats'],
        template: "#doc-common-template"
    };
    //组件-代码视图
    const CodeView = {
        props: ['code', 'language'],
        data() {
            return {
                darkTheme
            }
        },
        template: "#code-view-template"
    };

    const app = createApp({
        data() {
            const osThemeRef = useOsTheme();
            const themeApp = ref(osThemeRef.value === 'dark' ? darkTheme : null);
            const loading = ref(true)
            const hljs = window.hljs;
            const classes = ref([]);
            const version = ref(null);
            const statistics = ref({
                classCount: 0,
                methodCount: 0
            });

            <!-- Theme -->
            const theme = {
                darkTheme: darkTheme,
                defaultTheme: osThemeRef.value,
                //todo 系统主题变更
                osTheme: computed(() => (osThemeRef.value === 'dark' ? darkTheme : null)),
                handleUpdateValue: function (value) {
                    themeApp.value = value === 'dark' ? darkTheme : null;
                },
                style: ({
                            focused,
                            checked
                        }) => {
                    const style = {};
                    if (checked) {
                        style.background = "rgb(38, 38, 42, 1)";
                    }
                    return style;
                }
            }

            <!-- Catalog -->
            const catalog = ref({
                width: "400px",
                height: "500px",
                hideShow: true,
                btnText: 'Hide'
            });
            const catalogBtnClick = function () {
                catalog.value.hideShow = !catalog.value.hideShow;
                catalog.value.btnText = catalog.value.hideShow ? 'Hide' : 'Catalog';
                catalog.value.width = catalog.value.hideShow ? '400px' : '100px';
                catalog.value.height = catalog.value.hideShow ? '500px' : null;
            }

            <!-- 废弃字段/文档描述/时间格式化自定义 -->
            const customDocCommonRow = function (record) {
                return h(DocCommon, {
                    "docs": record.docComment && record.docComment.docs,
                    "deprecated": record.deprecated,
                    "dateTimeFormats": record.annotations && record.annotations.filter(item => item.annotationType === "DateTimeFormat")
                });
            }

            //表头
            const tablecolumns = {
                //请求参数表格头
                paramcolumns: [
                    {
                        title: "Parameter",
                        key: "fieldName"
                    },
                    {
                        title: "Type",
                        key: "typeName"
                    },
                    {
                        title: "Required",
                        key: "required"
                    },
                    {
                        title: "DefaultValue",
                        key: "defaultValue"
                    },
                    {
                        title: "Description",
                        key: "docComment",
                        render: function (record) {
                            return customDocCommonRow(record);
                        }
                    }
                ],
                //Cookie表格头
                cookiescolumns: [
                    {
                        title: "Parameter",
                        key: "name"
                    },
                    {
                        title: "Type",
                        key: "type"
                    },
                    {
                        title: "Required",
                        key: "required"
                    },
                    {
                        title: "DefaultValue",
                        key: "defaultValue"
                    },
                    {
                        title: "Description",
                        key: "docComment",
                        render: function (record) {
                            return customDocCommonRow(record);
                        }
                    }
                ],
                //请求Head表格头
                headercolumns: [
                    {
                        title: "Parameter",
                        key: "name"
                    },
                    {
                        title: "Type",
                        key: "type"
                    },
                    {
                        title: "Required",
                        key: "required"
                    },
                    {
                        title: "DefaultValue",
                        key: "defaultValue"
                    },
                    {
                        title: "Description",
                        key: "docComment",
                        render: function (record) {
                            return customDocCommonRow(record);
                        }
                    }
                ],
                //返回结果表格头
                responsecolumns: [
                    {
                        title: "Field",
                        key: "fieldName"
                    },
                    {
                        title: "Type",
                        key: "typeName"
                    },
                    {
                        title: "Description",
                        key: "docComment",
                        render: function (record) {
                            return customDocCommonRow(record);
                        }
                    }
                ],
                //返回结果表格头
                responsenochildrencolumns: [
                    {
                        title: "Type",
                        key: "resultName"
                    },
                    {
                        title: "Description",
                        key: "docComment",
                        render: function (record) {
                            return customDocCommonRow(record);
                        }
                    }
                ]
            }

            //初始化数据
            const initData = function () {
                //接口json数据
                new Promise((resolve, reject) => {
                    setTimeout(() => {
                            resolve(
                                {
                                    classes : [{"className":"com.power.doc.controller.TagsController","docComment":{"docs":["注释tag","用例"],"docTags":[{"name":"author","value":"yu","datas":["2020/7/2."]}]},"methods":[{"url":"http://localhost/tags/apiNote","type":"POST","contentType":"application/x-www-form-urlencoded;charset\u003dUTF-8","headers":[],"cookies":[],"queryParams":[{"example":["Aw"],"typeName":"array\u003cstring\u003e","fieldName":"user","docComment":{"docs":[],"docTags":[]},"duplicate":false,"generic":true,"enum":false,"annotations":[]}],"pathParams":[],"curlExample":"curl -X POST -i http://localhost/tags/apiNote --data \u0027user\u003dS5\u0027","methodName":"test","docComment":{"docs":["测试apiNote tag"],"docTags":[{"name":"author","value":"cht","datas":[]},{"name":"apiNote","value":"#","datas":["This method returns a List instead of a Collection or Stream","* because processing of multiple Wombats usually involves traversing","* the list in alternating forward and reverse directions."]},{"name":"return","datas":[]}]},"result":{"resultName":"string","enum":false,"example":"xR"},"parameters":[{"example":["Aw"],"typeName":"array\u003cstring\u003e","fieldName":"user","docComment":{"docs":[],"docTags":[]},"duplicate":false,"generic":true,"enum":false,"annotations":[]}],"resultExample":"\"xR\"","paramExample":"http://localhost/tags/apiNote","deprecated":true,"author":"cht"},{"url":"http://localhost/tags/mock","type":"POST","contentType":"application/json","headers":[],"cookies":[],"queryParams":[],"pathParams":[],"requestBodyParams":[{"example":{"subUserName":"AMLy8nopKQ","numbers":390},"typeName":"object","fieldName":"user","docComment":{"docs":[""],"docTags":[]},"childField":[{"typeName":"string","fieldName":"subUserName","docComment":{"docs":["用户名称","水水水水","ddddd"],"docTags":[{"name":"mock","value":"张三","datas":[]}]},"generic":false,"enum":false,"deprecated":false,"required":"true","annotations":[{"annotationType":"Required","value":"true"}]},{"typeName":"nu ypeName":"object","fieldName":"data","generic":false,"enum":false,"deprecated":false,"annotations":[]},{"typeName":"string","fieldName":"code","generic":false,"enum":false,"deprecated":false,"annotations":[]},{"typeName":"string","fieldName":"timestamp","generic":false,"enum":false,"deprecated":false,"annotations":[]},{"typeName":"string","fieldName":"traceId","generic":false,"enum":false,"deprecated":false,"annotations":[]}],"enum":false,"example":{"traceId":"8OrXr","code":"YzSMslt7n","success":false,"message":"X83hHux","timestamp":"J"}},"parameters":[],"resultExample":"{\n  \"traceId\": \"8OrXr\",\n  \"code\": \"YzSMslt7n\",\n  \"success\": false,\n  \"message\": \"X83hHux\",\n  \"timestamp\": \"J\"\n}","paramExample":"http://localhost/multi/mapping/methods/startJob","deprecated":false,"author":""}],"deprecated":false,"author":"yu3.sun"}],
                                    version : "\u003cdependency\u003e\n\t\u003cgroupId\u003ecom.power.doc\u003c/groupId\u003e\n\t\u003cartifactId\u003esmart-doc-example-cn\u003c/artifactId\u003e\n\t\u003cversion\u003e0.0.1-SNAPSHOT\u003c/version\u003e\n\u003c/dependency\u003e"                                        }
                            )
                        }
                    )
                }).then((res) => {
                    const genUnionTableKey = function () {
                        return "tablekey-" + 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
                            var r = Math.random() * 16 | 0, v = c == 'x' ? r : (r & 0x3 | 0x8);
                            return v.toString(16);
                        });
                    }

                    const forTableDataId = function (objs) {
                        if (!objs) {
                            return;
                        }
                        objs.forEach(item => {
                            item.id = genUnionTableKey();
                            forTableDataId(item.childField);
                        })
                    }

                    <!-- 文档注释处理 -->
                    const mergeDocs = function (value) {
                        if (value == null) return "";
                        const docs = value.docs;
                        if (docs == null || docs.length < 1) {
                            return "";
                        }
                        var result = "";
                        for (var i = 0; i < docs.length; i++) {
                            if (i + 1 == docs.length) {
                                result += docs[i];
                            } else {
                                result += docs[i] + " ";
                            }
                        }
                        return result;
                    }

                    res.classes && res.classes.forEach(clazz => {
                        const clazzComment = mergeDocs(clazz.docComment);
                        clazz.id = genUnionTableKey();
                        clazz.showName = clazzComment ? clazzComment : clazz.className;
                        clazz.methods && clazz.methods.forEach(method => {
                            const methodComment = mergeDocs(method.docComment);
                            method.id = genUnionTableKey();
                            method.showName = methodComment ? methodComment : method.methodName;
                            if(method.result) {
                                method.result.id = genUnionTableKey();
                                forTableDataId(method.result.fields);
                            }
                            forTableDataId(method.cookies);
                            forTableDataId(method.headers);
                            forTableDataId(method.queryParams);
                            forTableDataId(method.pathParams);
                            forTableDataId(method.parameters);
                            forTableDataId(method.requestBodyParams);
                        });
                        classes.value.push(clazz);
                    });

                    //赋值
                    version.value = res.version;

                    statistics.value = {
                        classCount: classes.value ? classes.value.length : null,
                        methodCount: classes.value.reduce(function (prev, next) {
                            if (next == null || next.methods == null) {
                                return prev;
                            }
                            return prev + next.methods.length
                        }, 0)
                    }

                    loading.value = false;
                }).catch((err) => {
                    loading.value = false;
                });
            }
            onMounted(() => {
                initData();
            })

            <!-- html转义 -->
            const unescape = function (html) {
                try {
                    if (!html) {
                        return html;
                    }
                    return html
                        .replace(html ? /&(?!#?\w+;)/g : /&/g, '&amp;')
                        .replace(/&lt;/g, "<")
                        .replace(/&gt;/g, ">")
                        .replace(/&quot;/g, "\"")
                        .replace(/&#39;/g, "\'");
                } catch (e) {
                    return html;
                }
            }

            return {
                theme,
                themeApp,
                loading,
                //二方库
                hljs,
                //变量
                classes,
                version,
                statistics,
                catalog,
                //表头
                tablecolumns,
                //方法
                catalogBtnClick,
                unescape,
                rowKey: (row) => row.id,
            }
        }
    });
    app.use(naive);
    app.component("codeview", CodeView);
    app.mount('#pgdoc');
